-- we use sqlite as the primary database

-- create user table
-- Individual(Host, Visitor), Enterprise
CREATE TABLE IF NOT EXISTS User (
    username TEXT PRIMARY KEY,
    password TEXT NOT NULL,
    first_name TEXT NOT NULL ,
    last_name TEXT NOT NULL ,
    birthday TEXT NOT NULL ,
    user_type TEXT NOT NULL,
    confirm TEXT DEFAULT 'False',
    avatar TEXT DEFAULT 'data:image/jpeg;base64,',
    token TEXT,
    reward INTEGER DEFAULT 0
);

VALUES ('123@qq.com','123', 'li', 'shunyang', '1998-08-12', 'individual','True','');


CREATE TABLE IF NOT EXISTS Hotel (
	id INTEGER PRIMARY KEY,
    name TEXT NOT NULL,
    phone TEXT NOT NULL,
    location TEXT NOT NULL,
    email TEXT,
    price REAL NOT NULL DEFAULT 100,
    web TEXT,
    description TEXT,
    host TEXT NOT NULL DEFAULT '123@qq.com',
    room_type TEXT NOT NULL DEFAULT 'Large',
    bathrooms TEXT NOT NULL DEFAULT 'Yes',
    bedrooms INTEGER NOT NULL   DEFAULT 2,
    FOREIGN KEY (host) REFERENCES User(username)
);

-- this part is new hotels
CREATE TABLE IF NOT EXISTS Hotels (
    hotel_id INTEGER PRIMARY KEY ,
    hotel_name TEXT  NOT NULL ,
    hotel_address TEXT NOT NULL ,
    description TEXT NOT NULL ,
    phone TEXT NOT NULL ,
    email TEXT NOT NULL,
    host TEXT NOT NULL ,
    FOREIGN KEY (host) REFERENCES User(username)
);

CREATE TABLE IF NOT EXISTS Rooms (
    room_id INTEGER PRIMARY KEY ,
    hotel_id INTEGER NOT NULL ,
    name TEXT NOT NULL ,
    bedroom INTEGER NOT NULL ,
    bathroom INTEGER NOT NULL ,
    adults INTEGER NOT NULL ,
    children NOT NULL ,
    price REAL NOT NULL ,
    FOREIGN KEY (hotel_id) REFERENCES Hotels(hotel_id)
);


CREATE TABLE IF NOT EXISTS Hotels_img (
    hotel_id INTEGER NOT NULL,
    url TEXT NOT NULL,
    FOREIGN KEY (hotel_id) REFERENCES Hotels (hotel_id)
);

CREATE TABLE IF NOT EXISTS Rooms_img (
    room_id INTEGER NOT NULL ,
    url TEXT NOT NULL ,
    FOREIGN KEY (room_id) REFERENCES Rooms (room_id)
);


